'''宫泽佐江'''（日语：'''{{Ruby|宮澤 佐江|みやざわ さえ|lj}}'''）是AKB48二期生，原Team K成员。2012年，AKB48东蛋演唱会初日组阁，宣布移籍至SNH48；2013年，AKB武道馆演唱会宣布兼任AKB48 TeamK,同年总选宣布放弃兼任，专心SNH48；2014年，AKB48大组阁，宣布兼任SKE48 TeamS队长；2015年，12月16日于FNS歌谣祭上宣布从48Group毕业。

== 简介 ==
AKB48二期生，团内元气担当，以男前路线出名（48Group传闻：所有成员都有极度迷恋宫泽佐江的时期。出处：HaKaTa百货店），有AKB男朋友的称号
